import React from 'react';
import { Bar } from "react-chartjs-2";

const BarUI = ( {labels, figures} ) => {

    const data = () => {
        labels: {labels}
        datasets: [{
            label: "Cases Last Two Weeks",
            hoverBackgroundColor: "red",
            backgroundColor: "pink",
            data: {figures},
            barThickness: "flex",
        }]
    }


    return (
        <>
            <div>
                <Bar
                    width={400}
                    height={400}
                    data={data}
                    options={{
                        maintainAspectRatio: false,
                    }}
                />
            </div>
        </>
    );

}

export default GraphUI
